DROP DATABASE IF EXISTS reviews_db;

CREATE DATABASE reviews_db;

USE reviews_db;


CREATE TABLE `reviews` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`user_name` VARCHAR(50) NOT NULL COLLATE 'utf8_unicode_ci',
	`property_id` INT(11) NOT NULL COLLATE 'utf8_unicode_ci',
	`message` VARCHAR(500) NOT NULL COLLATE 'utf8_unicode_ci',
	`date_created` DATE NOT NULL,
    `user_img_url` VARCHAR(300)  NOT NULL,
	`accuracy_rating` DECIMAL(2, 1) NOT NULL,
    `location_rating` DECIMAL(2, 1) NOT NULL,
    `cleanliness_rating` DECIMAL(2, 1) NOT NULL,
    `communication_rating` DECIMAL(2, 1) NOT NULL,
    `value_rating` DECIMAL(2,1) NOT NULL,
    `Check_in_rating` DECIMAL(2,1) NOT NULL,
	PRIMARY KEY (`id`),
	UNIQUE INDEX `user_name` (`user_name`)
)   
COLLATE='utf8_unicode_ci'
ENGINE=InnoDB;


